import React from 'react'
import { Link } from 'react-router-dom';

function Header({ title , leftBtn  }) {
  return (
    <div className="header">
        <h2>{ title }</h2>
        <div className="buttons-wrapper">
            { leftBtn }
        </div>
    </div>
  )
}

export default Header
